package Lec1;

public class Arithmetic_Operators {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 9;
		int b = 7;
		int c = a + b;
		System.out.println(c);
		int d = a - b;
		System.out.println(d);
		int e = a * b;
		System.out.println(e);
		int f = a/b;
		System.out.println(f);

	}

}
